import React, { Component } from 'react';
class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      list: [{name:'sanjana',
              age:'25',
              username:'sanj31'}],
    };
  }
  render() {
    return (
      <div>
        <ul>
          {this.list.map(item => (
            <li key={item}>{item}</li>
          ))}
        </ul>
      </div>
    );
  }
}
export default App;
